import React from 'react';
import { Box, Button, Grid, Typography, useTheme } from '@mui/material';
import { useNavigate } from 'react-router-dom';

const RealEstateBot = () => {
    const navigate = useNavigate();
    const theme = useTheme();

    const style = {
        container: {
            padding: theme.spacing(3),
            color: theme.palette.common.white,
            backgroundColor: theme.palette.background.default,
            minHeight: '100vh',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'center',
        },
        header: {
            marginBottom: theme.spacing(2),
        },
        paragraph: {
            marginBottom: theme.spacing(1),
        },
        featureBox: {
            marginTop: theme.spacing(4),
            textAlign: 'left',
        },
        featureHeading: {
            marginBottom: theme.spacing(1),
        },
    };

    return (
        <Box sx={style.container}>
            <Typography variant="h2" sx={style.header}>RealEstate AI Bot</Typography>
            <Typography variant="body1" sx={style.paragraph}>
            This script defines the core functionality of a Real Estate Assistant Discord Bot.
            It integrates with OpenAI's GPT models to process user inquiries related to the real estate market, focusing on the Toronto and Ontario regions. 
            The bot maintains a conversation history for context management, analyzes word frequency vectors, classifies utterances for emotional tone or speech act, and uses two different OpenAI API calls (completion and chat models) to generate informative and relevant responses.
            </Typography>
            <Typography variant="body1" sx={style.paragraph}>
                Explore the core features and technologies that power this innovative tool.
            </Typography>

            <Box sx={style.featureBox}>
                <Typography variant="h4" sx={style.featureHeading}>Key Features:</Typography>
                <ul>
                    <li><Typography variant="body1">Advanced language model interactions for real estate queries.</Typography></li>
                    <li><Typography variant="body1">In-depth word frequency analysis for precise query understanding.</Typography></li>
                    <li><Typography variant="body1">Emotional tone and speech act classification for nuanced responses.</Typography></li>
                    <li><Typography variant="body1">Context-aware conversations for relevant and coherent dialogues.</Typography></li>
                    <li><Typography variant="body1">Optimized response generation with redundancy checks.</Typography></li>
                </ul>
            </Box>

            <Button
                variant="contained"
                color="primary"
                onClick={() => navigate('/')}
                style={{ marginTop: theme.spacing(3) }}
            >
                Go Back Home
            </Button>
        </Box>
    );
};

export default RealEstateBot;
